import React from 'react';
import Todo from './Todo';

function Todolist() {
  return (
    <div>
      <h1>Unsere Todos</h1>  
      <Todo></Todo>
      <Todo></Todo>
      <Todo></Todo>
    </div>
  )
}

export default Todolist
